import './App.css';

import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
	return (
		<div className='app'>
			<Router>
				<Routes>
					<Route path='/admin' element={<Customer></Customer>}>
						<Route path='/customer' element={<Customer></Customer>} />
					</Route>
				</Routes>
			</Router>
		</div>
	);
}

export default App;
